スナップスは、充電時・データ転送時の機器の接続を、差し込み式からマグネット方式に変換する小さなアダプターです。<br><br>
アダプターをケーブル端子に、コネクターを機器に差し込むだけの簡単操作。スナップスがそれぞれの接続端子を保護し、マグネット式に変換できます。<br><br>
iPhone 5以降のiPhoneやiPad、iPodで使用されている Lightning（ライトニング）ケーブル対応のスナップスです。<br><br>
ライトニング専用：iPhone5から採用され、以来iPhone、iPad、iPodなどに採用されている規格です。iPhone5、6はもちろん、iPhone7まで対応しています。<br>※ iPhone7のライトニングイヤホンには対応しておりません。<br>※ 充電ポートを汚れから保護しますが、製品自体には防水機能はございません。<br><br>
製品内容：アダプター x 2、コネクター x 1　本体カラー：ホワイト<br>アダプター2個入りのセットですので、ご自宅と車内など、2本の充電ケーブルをご利用の方に最適です。<br><br>
【お届けする製品のパッケージについて】海外よりパッケージに入った状態で入荷しますので、当方での最終検品ができません。つきましては、動作確認のため、パッケージを一旦開封しておりますので、ご理解いただきご容赦くださいますよう、よろしくお願い申し上げます。<br><h2>ZNAPS</h2>
