いつでも持ち運べる本革キーホルダー！MicroUSBの充電ケーブル付きで充電可能！<br>
<br>
おしゃれなデザインで身につけて持ち運べるキーホルダー！<br>
キーホルダーにはMicroUSBの充電ケーブルが付いているのでモバイルバッテリーを<br>
持っているけど充電ケーブルが無い時などケーブルを使用して充電することができます。<br>
急速充電＆データ通信に対応！パソコンとデータ転送できます！<br>
<br>
ケーブルは急速充電に対応しているので、スマートフォンと充電器が急速充電に<br>
対応していれば高速で充電することができます。<br>
<br>
データ通信にも対応しており、パソコンと接続してデータ転送が可能です。<br>
<br>
キーホルダーとして利用可能！身につけて持ち運びできます！<br>
<br>
リング部分はバネ式のカラビナになっており、鍵などを取り付けることができます。<br>
身につけて持ち運べるのでスマートフォンを充電したいときにも便利です。<br>
<br>
材質：本革<br>
端子：MicroUSB<br>
カラー：ブラック、ブラウン<br>
サイズ(約)：長さ21cm<br>
重量(約)：29g<br>
製造国：中国<br>
<br>
※モバイルバッテリー等は付属しておりません。<br>
※輸入商品の為、若干の小キズがある場合が御座います。<br>
※こちらの商品はメール便発送にて送料無料です。<br>
※ゆうメールでの発送は（ポスト投函）代金引換、日付指定はできませんのでご了承ください。<br>
