OTG変換アダプタをMacBookやスマホに接続するだけ！<br>
OTGに対応したスマートフォンやMacBookなどのType-Cポートに接続するだけで、<br>
マウスやキーボード等の機器が使えるようになります。<br>
<br>
Type-Cコネクタで裏表に向きを気にせずに使えるリバーシブル規格<br>
アダプタを接続する際にコネクタの向きを気にせずに使えるType-Cコネクタ！<br>
アルミニウム合金素材を採用しており耐久性が高いです。<br>
<br>
スマホの写真や動画をUSBメモリに保存できます。<br>
OTG変換アダプタを接続するだけで使えるので簡単に使用できます。<br>
<br>
対応機種：OTGに対応したType-C搭載のスマートフォンやMacBook<br>
サイズ(約)：3.1cm×1.4cm×0.7cm<br>
カラー：ゴールド、シルバー<br>
製造国：中国<br>
<br>
